INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (401, 24, 2, 2, 24001, 0.0, 0.0, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "アヤネ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 102301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (402, 24, 2, 1, 24002, 0.0, 0.0, 2.21, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "アヤネ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 102301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (403, 24, 2, 2, 24003, 0.0, 0.0, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "アヤネ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 102301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (701, 24, 1, 2, 24004, 0.0, 0.0, 1.99, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "アサヒ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192201);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (702, 24, 2, 1, 24005, 0.0, 0.0, 2.21, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "アサヒ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192201);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (703, 24, 1, 2, 24006, 0.0, 0.0, 3.33, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "アサヒ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192201);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (801, 24, 2, 2, 24007, 0.0, 0.0, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "部員３", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (802, 24, 2, 1, 24008, 0.0, 0.0, 2.68, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "部員３", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (803, 24, 2, 2, 24009, 0.0, 0.0, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "部員３", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (501, 24, 1, 1, 24010, 0.0, 0.0, 0.0, "やった！", "", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (502, 24, 1, 1, 24011, 0.0, 0.0, 0.0, "勝ったよ！", "", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (503, 24, 1, 1, 24012, 0.0, 0.0, 0.0, "いい調子！", "", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (111, 24, 2, 6, 24013, 0.0, 0.0, 5.33, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "ミサト", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (112, 24, 2, 1, 24014, 0.0, 0.0, 6.85, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "ミサト", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (113, 24, 2, 1, 24015, 0.0, 0.0, 3.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "ミサト", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (611, 24, 2, 1, 24016, 0.0, 0.0, 6.11, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "ダイチ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (612, 24, 2, 1, 24017, 0.0, 0.0, 6.75, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "ダイチ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (613, 24, 2, 2, 24018, 0.0, 0.0, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "ダイチ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (211, 24, 1, 2, 24019, 0.0, 0.0, 4.52, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "ハツネ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (212, 24, 1, 2, 24020, 0.0, 0.0, 3.89, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "ハツネ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (213, 24, 2, 1, 24021, 0.0, 0.0, 13.49, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "ハツネ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113401);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (311, 24, 2, 1, 24022, 0.0, 0.0, 3.17, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "カヤ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 106501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (312, 24, 2, 1, 24023, 0.0, 0.0, 4.42, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "カヤ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 106501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (313, 24, 1, 6, 24024, 0.0, 0.0, 2.89, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "カヤ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 106501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (421, 24, 3, 4, 24025, 0.0, 0.0, 3.71, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "アヤネ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 102301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (721, 24, 1, 2, 24026, 0.0, 0.0, 5.1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "アサヒ", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192201);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (821, 24, 3, 1, 24027, 0.0, 0.0, 4.34, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "部員３", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192301);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (521, 24, 1, 1, 24028, 0.0, 0.0, 0.0, "いい勝負だったよ\nまたやろうね", "", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 192501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (101, 24, 2, 1, 24029, 0.0, -360.0, 5.62, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "ミサト", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (102, 24, 2, 1, 24030, 0.0, -360.0, 9.58, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "ミサト", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (103, 24, 2, 2, 24031, 0.0, -360.0, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "ミサト", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (104, 24, 1, 2, 24032, 0.0, -360.0, 9.13, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "ミサト", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113501);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (105, 24, 2, 1, 24033, 0.0, -360.0, 8.27, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "ミサト", "2020/07/31 12:00:00", "2030/12/17 14:59:59", 10046, 113501);
